import "./home.css"
import Profile from "../Profile/Profile";


export default function Home(){
    return(
        <div>
            <Topbar/>
            <div className="home_container">
            <Sidebar/>
            <Feed/> 
            <RightBar/>
            {/* <Profile/> */}
            

            </div>

        // </div>
    );
}
